import React from "react";
import './Reminder.css';

function ReminderCard({title,description,date,onDelete}) {
    return (
        <div className="card">
            <h2>{title}</h2>
            <p>{description}</p>
            <p>{date}</p>
            <button onClick={onDelete}>Delete</button>
        </div>
    );
}
